import '../styles/settingbar.scss'

const SettingsBar = () => {
	return (
		<div className='setting-bar'>
			<label htmlFor='line-width'>Толщина линии</label>
			<input
				id='line-width'
				type='number'
				min={1}
				max={50}
				style={{ margin: '5px', width: '70px' }}
			/>
		</div>
	)
}

export default SettingsBar
